import React, {useEffect, useState} from 'react';
import axios from "axios";
import {Table} from 'react-bootstrap';
import { MovieDto } from '../model';

const MoviesTable: React.FC = () => {

    const [movies, setmovies] = useState<MovieDto[]>([])
    const URL: string = "http://localhost:8080/app/movies";
  
    useEffect(() => {
      axios.get(URL, {params: {"pageSize" : 20}}).then(res =>{
        setmovies(res.data.content);
      })
    }, [])

  return (
    <Container>
    <Table striped bordered hover variant='dark' size='sm'>
        <thead>
          <tr>
            <th>Title</th>
            <th>Date</th>
            <th>Rating</th>
            <th>Revenue</th>
          </tr>
        </thead>
        <tbody>
          {movies.map((movie) =>(
            <tr key={movie.id}>
              <th>{movie.title}</th>
              <th>{movie.date}</th>
              <th>{movie.rating}</th>
              <th>{movie.revenue}</th>
            </tr>
          )
          )}
        </tbody>
      </Table>
      </Container>
  )
}

export default MoviesTable
